 */

import React from 'react';
import PropTypes from 'prop-types';

interface IKingProps {
  color: string;
}

class King extends React.Component<IKingProps, {}> {
  static propTypes = {
    color: PropTypes.string,
  };

  render() {
    const primaryColor = this.props.color === 'b' ? '#000000' : '#FFFFFF';
    const secondaryColor = this.props.color === 'b' ? '#FFFFFF' : '#000000';
    const path1 = `M 32,29.5 C 32,29.5 40.5,25.5 38.03,19.85 C 34.15,14 25,18
                   22.5,24.5 L 22.51,26.6 L 22.5,24.5 C 20,18 9.906,14
                   6.997,19.85 C 4.5,25.5 11.85,28.85 11.85,28.85`;
    const path2 = `M 22.5,25 C 22.5,25 27,17.5 25.5,14.5 C 25.5,14.5 24.5,12
                   22.5,12 C 20.5,12 19.5,14.5 19.5,14.5 C 18,17.5 22.5,25 22.5,25`;
    const path3 = `M 11.5,37 C 17,40.5 27,40.5 32.5,37 L 32.5,30 C 32.5,30 41.5,25.5
                   38.5,19.5 C 34.5,13 25,16 22.5,23.5 L 22.5,27 L 22.5,23.5 C 19,16
                   9.5,13 6.5,19.5 C 3.5,25.5 11.5,29.5 11.5,29.5 L 11.5,37 z`;
    let extra = null;
    if (this.props.color === 'b') {
      extra = (
        <path
          d={path1}
          style={{
            fill: 'none',
            stroke: '#ffffff',
          }}
        />
      );
    }
    return (
      <g transform="scale(.022222,.022222)">
        <g
          style={{
            fill: 'none',
            fillOpacity: 1,
            fillRule: 'evenodd',
            stroke: '#000000',
            strokeWidth: 1.5,
            strokeLinecap: 'round',
            strokeLinejoin: 'round',
            strokeMiterlimit: 4,
            strokeDasharray: 'none',
            strokeOpacity: 1,
          }}
        >
          <path
            d="M 22.5,11.63 L 22.5,6"
            style={{
              fill: 'none',
              stroke: '#000000',
              strokeLinejoin: 'miter',
            }}
          />
          <path
            d="M 20,8 L 25,8"
            style={{
              fill: 'none',
              stroke: '#000000',
              strokeLinejoin: 'miter',
            }}
          />
          <path
            d={path2}
            style={{
              fill: primaryColor,
              stroke: secondaryColor,
              strokeLinecap: 'butt',
              strokeLinejoin: 'miter',
            }}
          />
          <path
            d={path3}
            style={{
              fill: primaryColor,
              stroke: '#000000',
            }}
          />
          <path d="M 11.5,30 C 17,27 27,27 32.5,30" style={{ fill: 'none', stroke: secondaryColor }} />
          <path d="M 11.5,33.5 C 17,30.5 27,30.5 32.5,33.5" style={{ fill: 'none', stroke: secondaryColor }} />
          <path d="M 11.5,37 C 17,34 27,34 32.5,37" style={{ fill: 'none', stroke: secondaryColor }} />
          {extra}
        </g>
      </g>
    );
  }
}

export default King;
